            <div className="font-serif">
                <h1 className="text-blue-500 text-6xl font-medium">MySpace</h1>
                <p className="text-2xl pt-3">Take this opportunity to express</p>
            </div>
            <LogIn />
        </div>
     );
}
 
export default Home;
